(1258, '00001', 'Basic neonatal care package (Rs. 500 per day, maximum 1500): Babies that can be managed by side of mother in postnatal ward without requiring admission in SNCU/NICU:\nâ¢ Any newborn needing feeding support\nâ¢ Babies requiring closer monitoring or short-term care for conditions like: \no Birth asphyxia (need for positive pressure ventilation; no HIE)\no Moderate jaundice requiring phototherapy\no Large for dates (>97 percentile) Babies \no Small for gestational age (less than 3rd centile)  ', 'M3-00001', '500.00', '0.00', NULL, 1, '2019-05-16 06:43:53', '2019-05-16 06:43:53'),
(1259, '00002', 'Special Neonatal Care Package (Rs. 3000 per day, maximum of 18000 - pre-auth after 4 days): Babies that required admission to SNCU or NICU:\nBabies admitted for short term care for conditions like: \nâ¢ Mild Respiratory Distress/tachypnea\nâ¢ Mild encephalopathy \nâ¢ Severe jaundice requiring intensive phototherapy\nâ¢ Haemorrhagic disease of newborn\nâ¢ Unwell baby requiring monitoring\nâ¢ Some dehydration\nâ¢ Hypoglycaemia                           \nMother\'s stay and food in the hospital for breastfeeding, family centred care and (Kangaroo Mother Care) KMC is mandatory and included in the package rate                                                                                                                                                                                                                                ', 'M3-00002', '3000.00', '0.00', NULL, 1, '2019-05-16 06:43:54', '2019-05-16 06:43:54'),
(1260, '00003', 'Intensive Neonatal Care Package (Rs. 5000 per day, maximum of Rs. 50,000 â pre-auth is needed after 5 days)\nBabies with birthweight 1500-1799 g                                                                                                                                                                       \n                           or \nBabies of any birthweight and at least one of the following conditions:                                                                                               \nâ¢ Need for mechanical ventilation for less than 24 hours or non-invasive respiratory support (CPAP, HFFNC)                                                                                                                                                                                                                  \nâ¢ Sepsis / pneumonia without complications                                                                                                                   \nâ¢ Hyperbilirubinemia requiring exchange transfusion\nâ¢ Seizures\nâ¢ Major congenital malformations (pre-surgical stabilization, not requiring ventilation)                                                                                                                                                                                                                              \nâ¢ Cholestasis significant enough requiring work up and in-hospital management \nâ¢ Congestive heart failure or shock      \nMother\'s stay and food in the hospital for breastfeeding, family centred care and (Kangaroo Mother Care) KMC is mandatory and included in the package rate                                                                                                                    ', 'M3-00003', '5000.00', '0.00', NULL, 1, '2019-05-16 06:43:54', '2019-05-16 06:43:54'),
(1261, '00004', 'Advanced Neonatal Care Package (Rs. 6000 per day, maximum of Rs. 75,000 â pre-auth is needed after 7 days):\nBabies with birthweight of 1200-1499 g                                                                                                                                                    \n                                  or \nBabies of any birthweight with at least one of the following conditions: \nâ¢ Any condition requiring invasive ventilation longer than 24 hours                                                                                                                                                                                                                                                                                                                                                                                                                                      \nâ¢ Hypoxic Ischemic encephalopathy requiring Therapeutic Hypothermia                                                                                                                                              \nâ¢ Cardiac rhythm disorders needing intervention (the cost of cardiac surgery or implant will be covered under cardiac surgery packages)                                                                                                                                                                        \nâ¢ Sepsis with complications such as meningitis or bone and joint infection, DIC or shock\nâ¢ Renal failure requiring dialysis                                                                                                                                                                                                                          \nâ¢ Inborn errors of metabolism   \nMother\'s stay and food in the hospital for breastfeeding, family centred care and (Kangaroo Mother Care) KMC is mandatory and included in the package rate                                                                                                                                     ', 'M3-00004', '6000.00', '0.00', NULL, 1, '2019-05-16 06:43:54', '2019-05-16 06:43:54'),
(1262, '00005', 'Critical Care Neonatal Package (Rs. 7000 per day, maximum of Rs. 1,20,000 â pre-auth after 10 days):\nBabies with birthweight of <1200 g                                                                                                                                                   \n                           or \nBabies of any birthweight with at least one of the following conditions:                                                                                                \nâ¢ Severe Respiratory Failure requiring High Frequency Ventilation or inhaled Nitric Oxide (iNO)\nâ¢ Multisystem failure requiring multiple organ support including mechanical ventilation and multiple inotropes\nâ¢ Critical congenital heart disease     \nMother\'s stay and food in the hospital for breastfeeding, family centred care and (Kangaroo Mother Care) KMC is mandatory and included in the package rate                                                                                                                                     ', 'M3-00005', '7000.00', '0.00', NULL, 1, '2019-05-16 06:43:54', '2019-05-16 06:43:54'),
(1263, '00006', 'Chronic Care Package (Rs. 3000 per day, maximum of Rs. 30,000): If the baby requires stay beyond the upper limit of usual stay in Package no 0004 or 0005 for conditions like severe BPD requiring respiratory support, severe NEC requiring prolonged TPN support', 'M3-00006', '3000.00', '0.00', NULL, 1, '2019-05-16 06:43:54', '2019-05-16 06:43:54'),
